import React from "react";
import Layout from "../components/Layout";
import { Document, Page } from "react-pdf";
import "react-pdf/dist/Page/AnnotationLayer.css";

const MyImage = () => {
  return (
    <img
      src="/images/a.jpg"
      alt="mypic"
      height="auto"
      width="100px"
      style={{ borderRadius: "50%" }}
    />
  );
};

const Resume = () => {
  return (
    <Document file="../public/files/Resume.pdf">
      <Page pageNumber={1} />
    </Document>
  );
};

const handleClick = () => {
  console.log("resume button");
  <Resume />;
};

const Index = () => (
  <Layout>
    <div className="intro">
      <div className="introduction">
        <MyImage className="myImage" />
        <p>
          Hello, there <br />
          <span style={{ fontSize: "large" }}> I am </span>
          <span style={{ fontSize: "40px" }}> Pranesh Shrestha. </span>
        </p>
        <p>
          I am currently Computer Engineering Student.
          <br /> Welcome to my Portfolio Website.
        </p>
        <div className="resume">
          <button className="resumebtn" onClick={handleClick}>
            Resume
          </button>
        </div>
      </div>
    </div>
  </Layout>
);

export default Index;
